import React from "react";

function WeatherCard({ props }) {
  return (
    <div>
      WeatherCard
      <p clas>{props.name}</p>
      <p clas>{props.main.temp}&deg;C</p>
      <p clas>{props.sys.country}</p>
      <p clas>{props.sys.sunrise}</p>
      <p clas>{props.sys.sunset}</p>
      <p clas>{props.weather[0].main}</p>
      <p clas>{props.weather[0].description}</p>
      <p clas>{props.name}</p>
      <p clas>{props.name}</p>

    </div>
  );
}

export default WeatherCard;
